	description: "Le Parc naturel régional de la Haute Vallée de Chevreuse : ses domaines et châteaux, ses maisons en meulière au sein de villages charmants, ses routes désertes qui traversent des paysages naturels boisés... Ce parcours cyclotouristique par excellence est l’un des plus populaires d’Ile-de-France.",
	synopsis: "Au départ de la Gare de Saint-Rémy-les-Chevreuses, direction Boullay-les-Trous et première montée. Pas violente mais la vallée de Chevreuse, ça monte et ça descend. C’est le principe d’une vallée. Arrivés sur le plateau et vous rejoignez le Château de Breteuil. On vous en recommande la visite ainsi que celle des jardins.<br>
		Peu après avoir repris la route, vous passez devant l’EARL de la Budinerie où vous pourrez acheter une boule de pain bio. Si besoin, au pied du château des Bordes, vous trouverez une petite fontaine d’eau potable pour remplir votre bidon. Suivant la première grande descente du parcours, vous arrivez à la Celle-les-Bordes où vous admirez un nouveau château et l’Église attenante. 
		Il s’agit d’un château privé mais, si vous avez la chance de le croiser, le propriétaire vous y autorisera peut-être l’accès. A deux pas, pour un verre ou pour déjeuner, on ne saurait que trop vous conseiller de vous arrêter Aux Cinq Anneaux. Café dans son jus, gouaille du patron tantôt Audiard tantôt Groland, on y mange bien et on s’y sent bien. Si vous arrivez à en décoller, direction Clairefontaine-en-Yvelines et la majestueuse forêt de Rambouillet.<br>
		A la sortie de la forêt, si vous vous êtes obstinés à ne pas nous écouter, après les Cinq Anneaux, on vous propose un Quatre Etoiles. A la ferme aux Quatres Etoiles, vous pourrez acheter votre collation à l’épicerie de produits fermiers tenue par Jean-Baptiste. Pour la déguster, on vous recommande d’aller pic-niquer 2 kilomètres plus loin au bord de l’Étang de la Tour.<br>
		On ne ferait pas que manger par hasard ?! Franchement oui mais profitez-en, on vous proposera bien d’autres parcours tellement paumés que vous pleurerez pour trouver une boulangerie en chemin.<br>
		Bref, direction Auffargis et la bucolique Vallée des Vaux de Cernay. Entre les 45ème et 55ème kilomètre, vous traverserez les villages de Senlisse et de Dampierre avant d’affronter la « route des 17 tournants ». On ne vous en dit pas plus, vous verrez, c’est un moment sympa.<br>
		On vous entraîne ensuite jusqu’au magnifique site des restes de l’Abbaye de Port Royal des Champs. Si vous avez encore du temps, n’hésitez pas à en visiter le musée !<br>
		Les derniers kilomètres s’effectuent sans effort : redescente à Saint-Rémy-les-Chevreuses pour prendre une pinte de Barge avant de remonter dans le RER.<br>
		Bilan : Vous repartez avec un physique moins sportif qu’à votre arrivée !".html_safe,
	tinder_spot: "45 kilomètres qu’Aurélien et Agnès se suivent et 45 jours qu’ils se sont rencontrés pour la première fois lors de la crémaillère de Cédric, un ami commun qui a emménagé à Palaiseau. Grâce à planbidon, ils passent une journée magique au cours de laquelle ils se sont dangereusement rapprochés.<br>
		Il est 17h00, le soir commence à tomber sur ce beau dimanche de mai. C’est à cet instant, dans une descente échevelée, qu’ils croisent le Moulin de Cernay et entendent le bruit de sa cascade. Demi-tour. Seuls au monde, ils posent leurs vélos contre le muret de pierre et traversent le petit pont en bois. Ils admirent le ru qui s’écoule lentement mais sûrement vers le moulin. « Allons voir la cascade » propose Aurélien entraînant Agnès par la main. Ils restent un long moment à contempler l’eau qui se fracasse sur les pierres et qui poursuit son chemin à travers le creux d’un vallon humides et ombragés.<br>
		Revenant à leurs vélos, voulant les détacher, Aurélien se retourne vers Agnès pour lui demander la clef de sa chaîne. Au même moment, un ultime rayon de soleil illumine le visage d’Agnès qui se tient devant lui. Leurs regards se figent, le temps s’arrête. Ils ne seront jamais aussi beaux qu’à cet instant. Aurélien fait un pas vers Agnès, ses lèvres se détachent : « Je crois qu’elle est là. Dans ta poche de droite. La clef ».<br>
		Aurélien est un gros naze.".html_safe,
	se_cultiver: "Kilomètre 7 - Situé à Choisel, le château de Breteuil, édifié au 17ème siècle, est connu pour la qualité de ses intérieurs ainsi que pour la beauté de son parc et de ses jardins. Propriété de la même famille depuis 1712, vous en découvrirez l’histoire à travers la mise en scène des différentes pièces de l’édifice et les commentaires d’un conférencier. Toutes les infos ici :<br>
		Kilomètre 40 - L’Abbaye des Vaux-de-Cernay est un ancien monastère datant du 12ème siècle. Démembré après la révolution, il est sauvé de la ruine par la Baronne Charlotte de Rothschild en 1873. Le domaine est actuellement exploité comme hôtel-restaurant de charme. Visiter ce lieu enchanteur est néanmoins possible le weekend avec ou sans conférencier. Toutes les infos ici :<br>
		Kilomètre 45 - Le Petit Moulin de Cernay est le dernier des six moulins à eau bâtis au 13ème siècle par les moines de l’Abbaye. On y découvre les différents mécanismes du moulin, son rôle économique ainsi que la vie du meunier et sa place dans la vie rurale jusqu’au 20ème siècle. Si le Petit Moulin a été beaucoup transformé au cours de l’histoire, l’extérieur du bâtiment est bien préservé et de nombreux vestiges hydrauliques ornent encore le site. Toutes les infos ici :<br>
		Kilomètre 55 - Le site de Port-Royal des Champs est un ensemble constitué des ruines de l’abbaye de Port-Royal, du musée national de Port-Royal des Champs, et d’un domaine forestier et paysager. Lieu à l’histoire passionnante peu mise en valeur, l’endroit vaut largement le coup d’œil notamment le site des ruines où seul se dresse encore l’oratoire construit à la fin du 19ème siècle et tout récemment restauré. Le site du musée mérite également le passage et certaines expositions temporaires se révèlent intéressantes. Toutes les infos ici :<br>".html_safe,
	se_ravitailler: "Kilomètres 0 et 64 - En face de la gare RER de Saint-Rémy-les-Chevreuses, vous commandez au Chalet votre café du matin avant de vous élancer dans votre sortie ou, pour la finir, vous commandez une bonne Barge, bière artisanale produite à Rambouillet et servie à la pression. L’établissement propose des sandwichs et des plateaux de charcuterie corrects. Ouvert du lundi au vendredi de 7h00 à 20h00, le samedi de 8h à 20h et le dimanche de 09h00 à 20h00.<br>
		Kilomètre 15 - En agriculture biologique depuis 2001, Brigitte, Théo et Rick (EARL de la Budinerie) produisent eux-même leur blé pour réaliser une farine 100% meule de pierre. Cuits au four à bois, sur place, par leurs boulangers, les différents pains sont un régal. La boutique en vente directe est ouverte du mardi au vendredi de 10h à 13h et le samedi de 9h30 à 13h. <br>
		Kilomètre 18 - Ambiance Picon-Bière et cuisine maison dans cette merveille de troquet à l’ancienne, simple et familial. L’été aux Cinq Anneaux, pendant que les habitués rigolent au comptoir avec un patron haut en couleur, installez-vous sur la terrasse. L’hiver profitez du feu de cheminée qui vous ramène aux weekends à la campagne chez vos grands-parents. Menu déjeuner entrée-plat-dessert à 13€50. Ouverture de l’établissement les lundi, jeudi et vendredi de 11h30 à 15h30 et les samedi et dimanche de 11h30 à 20h00. <br>
		Kilomètre 30 - Installé depuis 2002, Jean-Baptiste est éleveur de vaches, de cochons et de poulets dont transforme et commerciales la production. La ferme, dite « aux Quatre Etoiles », comprend une boutique-bar où l’on trouve des fruits et légumes, de la charcuterie, du pain en provenance de la Budinerie, du miel, du fromage, des yaourts, des œufs, des confitures, des bières et même du vin. A vos sacoches ! Ouverture du vendredi au dimanche de 10h00 à 18h00. <br>
		Kilomètre 49 - Vous trouverez enfin à Dampierre deux cafés-restaurants sympas le long de la rue principale à proximité du château. Pour la soif, on confesse une tendresse pour le Petit Chalet qui propose de la Jupiler à la pression (planbidon est belgophile) et pour l’appétit on a du mal à résister aux très bons burgers du Comptoir de Marie. <br>".html_safe,
	transport: "Saint-Rémy-les-Chevreuse terminus ! Dernière gare du RER B Sud, il faut environ 45 minutes pour s’y rendre depuis Paris. En moyenne, un train toutes les 5 à 10 minutes dans les deux sens quelque soit le jour de la semaine. <br> 
		Les samedis, dimanches et jours fériés, aucun problème les vélos sont autorisés toute la journée. La semaine, en principe, les vélos ne sont autorisés qu’avant 6h30, puis entre 9h et 16h30, enfin après 19h. 
		Maintenant, même en heure de pointe, on a jamais eu de problème de place pour caser les nôtres. Malgré tout, si vous tombez sur un contrôleur dans le wagon, il peut y avoir embrouille. On n’a pas encore été confronté au cas. <br>
		4 compartiments vélos par train : un à chaque extrémité et deux vers le milieu. On vous recommande le wagon de queue toujours moins bondé.<br>
		Plan de ligne et horaires :".html_safe,
