	titre: 'Etampes - Andonville - Etampes', 
	distance: '103', 
	duree: '4h22 à 25km/h de moyenne sans pauses.', 
	denivele: '569 mètres', 
	difficulte: 'Route', 
	photo_url: 'https://res.cloudinary.com/planbidon/image/upload/v1584890480/2.%20Etampes%20-%20Andonville%20-%20Etampes/pb_2_nsziek.jpg', 
	photo_url_two: 'https://res.cloudinary.com/planbidon/image/upload/v1584890473/2.%20Etampes%20-%20Andonville%20-%20Etampes/pb_3_djbsqo.jpg',
	photo_url_three: 'https://res.cloudinary.com/planbidon/image/upload/v1584890479/2.%20Etampes%20-%20Andonville%20-%20Etampes/pb_1_hxkio3.jpg',
	description: "A cheval entre l’Ile-de-France et le Centre-Val de Loire, nous vous présentons la Beauce. Territoire défriché, les arbres y sont rares et les cultures céréalières s’étendent à perte de vue. Selon Rabelais, l'appellation 'Beauce' viendrait de la légende de Gargantua, qui un jour, ayant traversé la région sur sa jument, entra dans une forêt infestée de mouches. La jument, énervée par la présence des insectes, tua toutes les bêtes avec sa queue et arracha tous les arbres. C'est alors que Gargantua s'écria ''Oh ! Que c'est beau, ce !'', d'où le nom. Au départ d’Etampes, planbidon a une affection particulière pour ce parcours qui offre un dépaysement et une tranquillité absolus.",
	synopsis: "De la gare RER d’Etampes, cap plein Sud le long des berges ombragées de la Juine puis de l’Eclimont sur une quinzaine de kilomètres. Vous traversez quelques jolis hameaux dont celui de Bierville qui, outre son nom, abrite deux autres curiosités : Un château qui sert de centre de formation syndicale aux jaunes (aucune faute de frappe) de la CFDT et un insolite « Camp de la Paix » qui, en 1926, a accueilli 5000 jeunes catholiques venus de toute l’Europe mais principalement d’Allemagne. 
		Une sorte de JMJ avant l’heure. C’est ainsi que la commune de Boissy-la-Rivière, toute proche, connaît des noms de rues assez inhabituels pour ce genre de village : rue de la démocratie, rue des nations, rue de la fraternité, rue de la république, etc. <br>
		A partir d’Abbeville-la-Rivière, vous entrez dans la Beauce et découvrez ses paysages pelés et vous affrontez certainement un bon vent de face expliquant ainsi la présence de nombreuses éoliennes dans le secteur. A partir de maintenant si vous croisez plus de 5 personnes dans les 70 prochains kilomètres c’est qu’il se passe quelque chose d’anormal. <br>
		Cependant pour ne pas que vous vous sentiez trop seul, on vous fait passer par les villages de Sermaises, Autry-sur-Juine et surtout Léouville pour tenter d’y établir un contact avec les populations locales. <br>
		Vous traversez ensuite Arbouville où vous admirez les  vestiges d’une chapelle seigneuriale du 16ème siècle et les jolies façades colorées du bourg. Puis à Arnouville, vous apercevez depuis la route les belles façades d’un château 18ème siècle, inscrit à l’inventaire des Monuments Historiques. <br>
		A une dizaine de kilomètres de l’arrivée, à Chalo-Saint-Mars, on vous recommande de poser le pied à terre pour marcher dans le joli centre-village. Reposé, vous pouvez reprendre votre monture et conclure votre sortie en longeant la Louette sur ces 10 kilomètres qui vous séparent de l’arrivée. <br>
		Si vous êtes en été, profitez de la base de loisirs d’Etampes avant de rentrer chez vous ! <br>".html_safe,
	tinder_spot: "« Tu vas voir, on a pas l’impression comme ça mais 100 kilomètres c’est rien, en plus c’est hyper plat le parcours » avait promis Luka à Anne-Laure. Sauf qu’à voir le visage décomposé de sa compagne de cyclisme, Luka se demande s’il n’a pas un peu exagéré. Elle prétendait certes être sportive sur son profil mais cette fois ce n’est pas un gel énergétique qui va lui éviter le malaise vagal à 15 kilomètres de l’arrivée. Malheureusement, vous n’avez pas fait d’arrêt dans les boulangeries sur la route (il paraîtrait que les viennoiseries c’est gras) et maintenant c’est le mordor autour de vous. Luka se tourne vers Anne-Laure. Il ne voit plus des cœurs dans ses yeux mais bien des poignards qui ne tarderont pas à le frapper s’il ne trouve pas une solution. <br>
		Et là… miracle. Ici, au kilomètre 90 à  Chalou-Moulineux, le Maire a eu l’idée géniale de faire  planter à l’entrée du village tout un alignement de pommiers aux fruits merveilleusement sucrés. Anne-Laure se rue dessus comme Luka aurait espéré qu’elle se jette sur lui lorsqu’elle l’a vu ce matin devant chez elle dans son beau lycra Rapha. <br>
		« Et bien voilà, on est pas mal hein ? » tente-t-il de lancer à Anne-Laure qui finit son septième trognon. Il n’obtiendra pas de réponse et la suite du parcours se déroulera dans un silence pesant. <br>
		Dans les jours qui suivront, Anne-Laure ne répondra évidemment plus aux SMS de Luka. Il enverra tout de même un mail au Maire de Chalou-Moulineux pour le féliciter de son goût pour les arbres fruitiers. <br>
		Il est un peu con mais c’est un bon gars, Luka. <br>".html_safe,
	se_cultiver: "Etampes accueille une vaste base de loisirs dont la principale attraction est évidemment la piscine ouverte du 1er juillet au 31 août de 11h à 18h. On vous cache pas qu’un bon plouf l’après-midi après 100 kilomètres de vélo, c’est plutôt pas mal ! Le parc accueille également un minigolf, un terrain de tir-à-l’arc et même une patinoire. Découvrez toutes les activités offertes, ici : <br>
		La base est ouverte toute l’année à partir de 8h : <br>
		- Jusqu’à 20h du 1er avril au 30 mai ; <br>
		- Jusqu’à 22h du 1er juin au 31 août ; <br>
		- Jusqu’à 20h du 1er août au 30 septembre ; <br>
		- Jusqu’à 18h du 1er octobre au 31 mars. <br>".html_safe,
	se_ravitailler: "Kilomètre 0 – Face à la Gare d’Etampes, le Café du Départ est le bon endroit pour prendre votre petit-déjeuner si vous arrivez le ventre vide. Ouvert tous les jours sauf le dimanche de 5h00 à 22h00. Si un simple café est de nature à vous suffire, jetez un œil au LochNess dont on parle plus bas. <br>
		Un marché se tient dans le centre-ville tous les samedis toute la journée. Un autre, plus excentré, à lieu le mardi matin place Saint-Gilles. <br>
		Kilomètres 32 et 40  – A  Sermaise et Autry-sur-Juine, trois boulangeries vous permettront d’acheter votre croissant et votre baguette tous les jours de la semaine et une épicerie vous permettra de la garnir. Préférence pour la boulangerie-épicerie d’Autry-sur-Juine (dans la rue principale) ouverte tous les jours sur le lundi de 7h00 à 19h30. <br>
		Kilomètre 50 – Depuis 2009, Sylvie Karquet s’est lancée dans le maraichage biologique à Léouville dans la très jolie ferme du Petit Hôtel. Elle organise un petit marché à l’exploitation tous les vendredis soirs (16h30-18h30) et samedis matins (10h00-12h30) où, outre ses légumes, elle propose les produits des productions voisines (fruits, fromages et même de la bière !). <br>
		Kilomètre 95 – On arrive à la fin du parcours, la question du dernier verre se pose ! Pourquoi ne pas le prendre Chez Charly ? Surtout qu’on vous recommande de poser pied-à-terre pour déambuler dans le centre-village. Super spot pour manger un morceau ou simplement boire un verre en faisant un baby-foot ou un billard, accueil chaleureux, c’est un coup de coeur planbidon ! Ouvert du mardi au jeudi de 7h30 à 20h, les vendredis et samedis de 7h30 à 21h et le dimanche de 7h30 à 13h00. <br>
		Si vous préférez le pic-nique, la ferme de la Mare, également installée à Chalo-Saint-Mars, vous propose quant à elle ses spécialités de canard gras et une sélection de spiritueux régionaux (vin, cidre, bière). Vous devrez faire un détour de quelques kilomètres pour vous y rendre. Accessible à vélo, vous croiserez en chemin la boulangerie du village. Vente à la ferme les mercredis de 15h00 à 19h00 et du jeudi au samedi 9h00-12h00 et 15h00-19h00. <br>
		Terminus – A Etampes, planbidon vous conseille particulièrement : <br>
		- Le LochNess pour étancher une grosse soif. De l’avis des quelques personnes croisées par planbidon, ce bar aussi minuscule que sympa est le meilleur de la ville. Bières artisanales à la pression et bonne ambiance. Ouvert du mardi au samedi de 8h00 à 19h45. <br>
		- Le Café de l’Espérance pour étancher sa soif et éventuellement déjeuner ou grignoter. A la fois bistrot, bar à vin et caviste, c’est l’endroit idéal se délasser avec style après l’effort et discuter pinard avec un patron passionné. Menu entrée-plat-dessert à 15€ le midi et mets à la carte ; planches de fromage et charcuterie à tout moment. Ouvert du mardi au jeudi de 10h à 20h, le vendredi de 10h à 00h et le samedi de 10h à 17h. <br>".html_safe,
	transport: "Gare importante du tentaculaire RER C, il faut environ 1h00 pour s’y rendre directement depuis Paris. Avec un train environ toutes les 30 minutes dans le sens aller ou retour quelque soit le jour de la semaine, vous ne devriez pas avoir de problème. <br>
		Les samedis, dimanches et jours fériés, aucun problème les vélos sont autorisés toute la journée. La semaine, en principe, les vélos ne sont autorisés qu’avant 6h30, puis entre 9h et 16h30, enfin après 19h. Il arrive qu’il soit difficile de caser son vélo en heure de pointe le matin entre Paris et Brétigny-sur-Orge mais c’est rare. Malgré tout, si vous tombez sur un contrôleur dans le wagon, il peut y avoir embrouille. On n’a pas encore été confronté au cas. <br>
		Les wagons ne comportent pas spécifiquement de compartiments pour les vélos. On vous recommande toutefois d’aller aux extrémités du train, toujours moins bondés. <br>
		Plan de ligne et horaires : <br>".html_safe,
