	se_cultiver: "Echarçon 1er château km²<br>
		Château du Sauusay Ballancourt-sur-essonne (kilomètre 12) Ouverture : <br>
		- 1er avril au 1er octobre, les dimanches et jours fériés<br>
		- Tous les jours de septembre à partir du 1er dimanche<br>
		Ouvert toute l'année sur rendez-vous pour les groupes<br>
		Horaire : 14h-18h Visite guidée : Château et Parc<br>
		7€, 6€ pour les groupes de plus de 20 personnes (groupe sur demande), gratuit pour les moins de 12 ans. <br>
		Parc : 4,5€<br>
		Chateau de fleury en bière<br>
		Chateau de courance + boutique bio duchateau !!! <br>
		Chateau de Chamarande<br>
		Danemois moulin + tombe de claude françois<br>
		Moulin de danemois, maison de claude françois<br>
		Cyclop<br>".html_safe,
	se_ravitailler: "Le backgammon (bar) (KM 53) – Sur la place principale de Milly-la-Forêt, bon endroit pour siroter une bière sur une table au soleil. Ouvert les lundis, mardis, jeudi, vendredi et samedi de 07h30 à 20h00 sauf le dimanche jusqu’à 18h00. <br>
		Le rouge et le noir (kilomètre 78) – A Boissy-le-Cutté, Petit bar-tabac de village qui sort les tables et les parasols en terrasse l’été. C’est simple, c’est cool. Ouvert du mardi au vendredi de 6h30 à 20h et les samedis et dimanches de 08h00 à 13h00. <br>
		Le Pélican (kilomètre 92) – A quelques minutes du domaine de Chamarande, c’est THE spot glouglou du parcours. Ce pub qui accueille de nombreux concerts propose un choix de 6 bières à la pression dont une majorité de bières belges. A déguster avec une petite planche de charcut’. Ouvertures un peu WTF : les mercredis et jeudis de 11h à 00h, le vendredi de 11h à 2h, le samedi de 14h00 à 2h00, le dimanche de 12h à 21h. <br>
		Brasserie de la Juine (Kilomètre 92) – Pour boire une mousse, là il y a une vraie battle. Brasserie artisanale, selon la saison entre 6 et 9 sortes de bières sont brassées sur place et vous attendent.  Nous on est méga-fan de la brune à siroter sur les bords de la Juine à proximité. Ouvert les mercredis et vendredis de 16h00 à 19h00 et le samedi de 10h00 à 12h00 et de 15h00 à 19h00. <br>
		Signé vin (Terminus) – A Ménecy, réservation bien sec et gosier obligatoire (ou le contraire, on sait plus) pour profiter de cet excellent bar à vin où vous pouvez choisir de simplement prendre un verre ou de l’accompagner avec de quoi grignoter ou un vrai plat. Patron super sympa et concerts de temps en temps. Ouvert les mardis et mercredi de 10h à 14h30 et de 17h00 à 20h00, fermeture à 0h le jeudi, à 1h le vendredi, le samedi de 10h à 13h00 et de 17h à 1h00. <br>
		L’atelier Corse (Terminus) – En face de la gare, deuxième super restaurant à Menecy et à nouveau réservation obligatoire à l’Atelier Corse qui comme son nom l’indique propose une gastronomie typique de l’ile de beauté. Terrasse très agréable. Ouvert du lundi au samedi de 12h00 à 14h00 et de 19h00 à 22h00, le dimanche de 12h00 à 13h00 et de 19h00 à 21h00. <br>
		La Menara (Kilomètre 53) – A Milly-la-Forêt, un beau restaurant marocain à quelques coups de pédale du centre-ville. Dur de remonter en selle après le repas mais on compte sur votre force mentale. Ouvert du mardi au dimanche de 12h00 à 14h30 et de 19h00 à 22h30. <br>
		O’Resto (Kilomètre 54) – A Boutigny-Sur-Essonne, ce petit restaurant populaire offre un cuisine simple, bon marché et généreuse. Le personnel super gentil ce qui ne gâche rien. On recommande chaleureusement ! Ouvert du lundi au vendredi de 12h00 à 14h00 et de 19h00 à 21h00. <br>".html_safe,
	transport: "Le parcours est directement et facilement desservi par les RER C (Gare de Chamarande) et RER D (Gares entre Mennecy et Boutigny-sur-Essonne). Les fréquences de passage vont de la demi-heure à l’heure. <br>
		Au départ de Paris, on vous conseille de privilégier le RER C pour des questions de fiabilité et parce que le trajet est direct. Il faut compter environ 50 minutes. <br>
		Les samedis, dimanches et jours fériés, aucun problème les vélos sont autorisés toute la journée. La semaine, en principe, les vélos ne sont autorisés qu’avant 6h30, puis entre 9h et 16h30, enfin après 19h. Il arrive qu’il soit difficile de caser son vélo en heure de pointe sur les RER C et D mais c’est rare. Malgré tout, si vous tombez sur un contrôleur dans le wagon, il peut y avoir embrouille. On n’a pas encore été confronté au cas. <br>
		Aucun wagon n’est spécifiquement prévu pour les vélos, on vous recommande de vous mettre aux extrémités du train qui sont généralement les moins bondées. <br>
		Plan de ligne et horaires :".html_safe,
