Parcour.create!(
	titre: 'Coulommiers - La Vanne - Coulommiers', 
	distance: '80', 
	duree: '3h50 à 20km/h de moyenne sans pauses.', 
	denivele: '660 mètres', 
	difficulte: 'Route', 
	photo_url: 'https://res.cloudinary.com/planbidon/image/upload/v1584896000/3.%20Coulommiers%20-%20La%20Vanne%20-%20Coulommiers/pb_3_zyp3q5.jpg', 
	photo_url_two: 'https://res.cloudinary.com/planbidon/image/upload/v1584895999/3.%20Coulommiers%20-%20La%20Vanne%20-%20Coulommiers/pb_2_jcyutb.jpg',
	photo_url_three: 'https://res.cloudinary.com/planbidon/image/upload/v1584895999/3.%20Coulommiers%20-%20La%20Vanne%20-%20Coulommiers/pb_1_d7pwrh.jpg',
	description: "Ce parcours vous entraîne à la découverte du canton de Coulommiers et de la Vallée du Grand Morin. Avec ses nombreux cours d’eau, ses vastes prairies toujours vertes et ses hameaux isolés,  elle doit sa popularité à des artistes tels que Van Gogh ou Toulouse-Lautrec qui sont venus y peindre au cours de leur vie. C’est un itinéraire idéal pour tous ceux qui recherchent le grand air de la campagne à 1h de Paris en transilien.",
	synopsis: "Au départ de la Gare de Coulommiers, on sort de la ville en empruntant la RD 222 sur 4 kilomètres avant de monter jusqu’à Boissy-le-Chatel où commence véritablement le parcours. On suit le ru de fosse-rognon jusqu’à Doué et on remet le cap au Sud vers Rebais qui marque le début de la descente vers la Vallée du Grand Morin. L’itinéraire emmène jusqu’à la Ferté-Gaucher mais le passage par cette ville n’a d’intérêt que si vous souhaitez passer par une grande surface, dans le cas contraire on a prévu l’option pour l’éviter. A partir d’ici vous suivez les méandres du Grand Morin jusqu’au lieu-dit de la Bretonnière. On traverse un grand plateau agricole jusqu’à Saints où l’on entame le retour vers Coulommiers via Mauperthuis. On longe une dernière fois le Grand Morin entre Pommeuse et Mouroux avant d’arrivé à destination.",
	tinder_spot: "Le plan d’eau de Saint-Rémy-de-la-Vanne avec ses pédalos et sa buvette ouverte l’été. Ambiance Dupont Lajoie.",
	se_cultiver: "Fondée en 1990 en Italie, la Galleria Continua a été fondé afin de réinvestir des lieux laissés à l’abandon et de leur redonner vie à travers des projets d’art contemporain. Présente à Pékin et La Havane, la Galleria a pris possession en 2007 d’un quatrième lieu dans ancienne papeterie située à Boissy-la-Rivière. Au sein d’un complexe gigantesque, vous pourrez admirez les œuvres exposées dans les bâtiments et en plein air. Aux beaux jours, on vous conseille également d’y pic-niquer sur les bords du Grand Morin. Les horaires étant fonction des expositions, on vous conseille de téléphoner avant de vous y rendre.",
	se_ravitailler: "Kilomètre 9 – A Saint-Germain-de-Doue, Laurent Legouge entretien ses vergers avec amour. Pommes, poires mais aussi fraises, framboises et quetsches, vous pouvez évidemment achetez ces produits bruts mais aussi transformés en jus. Sa petite boutique propose aussi des produits fermiers telles que différentes variétés de miel, des biscuits ou des confitures. Ouvert du mardi au samedi de 9h à 12h et de 14h à 17h30.<br>
		Kilomètre 36 – En face la belle église de Jouy-Sur-Morin le traditionnel « Bar des Sports » au milieu duquel trône fièrement un baby-foot auquel vous pourrez défier quelques habitués après avoir siroté votre café. La terrasse à l’ombre offre une jolie vue sur la place. Ouvert les lundis, mardis, mercredis et vendredis de 07h à 20h, le samedi de 08h à 20h et le dimanche de 08h à 13h. <br>
		Kilomètre 42 – Fondée en 1929 à Saint-Siméon, la Société Fromagère de la Brie est l’une des plus anciennes du canton et l’une des plus réputés comme en témoigne un parking qui ne désemplit pas aux heures d’ouverture de la laiterie au public. Le choix est impressionnant, notamment en termes de fromages au lait cru. Vente directe le vendredi 9h00-12h00 13h30-18h00 et le samedi de 9h00 à 12h00. <br>
		Kilomètre 42 – Endroit WTF du parcours juste à côté de la Laiterie. Dans un jardin à côté d’une maison en meulière, un abri de jardin digne des marchés des Noël abrite des spécialités syriènnes et libanaises à manger sur place ou à emporter. Et c’est bon ! On recommande. Ouvert le vendredi de 17h30 à 20h et les samedis et dimanches de 11h à 14h et de 17h30 à 20h. <br>
		Kilomètre 49 - Le lycée agricole de la Bretonnière tient une boutique de produits en provenance de ses exploitations et de celles d’autres lycées agricoles de France. Vin, jus de fruit, charcuterie, biscuit : tout le nécessaire pour le pic-nique. Ouvert le vendredi 9h-12h30 et 13h-18h et les lundis et samedis le 9h00 à 12h30. <br>
		Kilomètre 72 – Le Rendez-vous des Pêcheurs, un bar au nom qui nous a immédiatement fait presser nos manettes de frein. Bar rural typique, vous pourrez y prendre la bière de l’amitié avant de remonter vers Coulommiers qui n’est plus qu’à quelques kilomètres. Ouvert les lundis, mardis, jeudis et vendredi de 7h45 à 19h00, les mercredis et samedis de 8h00 à 12h00. <br>
		Kilomètre 74 – Réservation obligatoire dans ce restaurant qui affiche quasiment complet tous les weekends ! Comme l’indique l’ardoise posée à l’entrée, à La Chaumière on mange bien, on s’en souvient et on y revient. Outre la bonne cuisine française traditionnelle entièrement faite maison, on peut simplement y siroter une bonne bière à choisir parmi un nombre remarquable de références. Ouvert les mercredis, jeudis et dimanches de 10h00 à 18h30 et les vendredis et samedis de 10h00 à 23h30. <br>
		Plusieurs boulangeries sur le parcours à Boissy-le-Chatel (km 5), Rebais (km 19), La Ferté-Gaucher (km 31), Saint-Siméon (km 42), Saints (km 54), Mouroux (km 74) et Jouy-Sur-Morin (km 36).".html_safe,
	transport: "Terminus de la ligne P du transilien, il faut  1h00 pour s’y rendre directement depuis Paris à partir de la Gare de l’Est. Pas de prise de tête, au moins un train toutes les heures aller-retour la semaine comme le weekend. <br>
		Les samedis, dimanches et jours fériés, aucun problème les vélos sont autorisés toute la journée. La semaine, en principe, les vélos ne sont autorisés qu’avant 6h30, puis entre 9h et 16h30, enfin après 19h. Il arrive qu’il soit difficile de caser son vélo en heure de pointe le matin entre Paris et Brétigny-sur-Orge mais c’est rare. Malgré tout, si vous tombez sur un contrôleur dans le wagon, il peut y avoir embrouille. On n’a pas encore été confronté au cas. <br>
		Les wagons avec les emplacements vélos sont au centre des wagons mais on a toujours pas vraiment compris ce qui les différenciait des autres. <br>
		Plan de ligne et horaires :".html_safe,
